import styled from "styled-components";
function Header() {
    const HeaderContainer = styled.div`
        background : black;
        color   :   white;
        padding :   24px 24px;
        display :   flex;
        flex-direction  :   row;
    `;

    const HeaderSubContainer = styled.div`
        color   :   white;
        padding :   8px;
        display :   flex;
        flex-direction  :   row;
        font-weight : 600;
    `;

    const SearchBar = styled.div`
        background  : #2d2d2d;
        padding     : 12px;
        width       : 100%;
        border      : solid 1px grey;
        border-radius   : 8px;
    `;

    const PrimaryGlowingButton = styled.div`
        background  :   #FFD8B5;
        color       : black;
        border-radius : 16px;
        padding     : 8px 16px;

    `;

    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <SearchBar/>
        </HeaderSubContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
